https://leetcode-cn.com/problems/cong-wei-dao-tou-da-yin-lian-biao-lcof/
<script>
  /**
   * Definition for singly-linked list.
   * function ListNode(val) {
   *     this.val = val;
   *     this.next = null;
   * }
   */
  /**
   * @param {ListNode} head
   * @return {number[]}
   */
  var reversePrint = function(head) {
    const res = [];
    while(head) {
      res.unshift(head.val);
      head = head.next;
    }
    return res;
  };
</script>
